import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react'

const coords = {
    center : {
        lat: 59.95,
        lng: 30.33
    },
    zoom: 11
}

function Map() {
    return (
        <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact
            defaultCenter={coords.center}
            defaultZoom={coords.zoom}
        >
            <p>Salut</p>

        </GoogleMapReact>
        </div>
    )
}

export default Map;
